import { useState } from "react";

function Home(){
    const [contador, constadorState] = useState(0);

    const plusplus = () => {
        constadorState(contador + 1)
    }

    return (
        <>
            <h1>
                {contador}
            </h1>
            <button onClick={plusplus}>Aumenta</button>
        </>
    );
    
}

export default Home;
